reset; echo
echo "Run this script in a folder containing."
echo "the 6236 audio verses of the Quran"
echo "Note that this number could vary if"
echo "each Sûrah has the Basmala as its"
echo "first verse. For example 002000 would"
echo "be the Basmala for Sûratul-Baqarah"
